import React from 'react'
import '../styles/Footer.scss'
import insta from '../assets/insta.svg'
import facebook from '../assets/facebook.svg'

function Footer() {
    return (
        <sections className="footer-section">
            <img src={insta} />
            <img src={facebook} />
        </sections>
    )
}

export default Footer
